import React from 'react';
import Tabbar from './navigation/Tabbar';
import { NavigationContainer } from '@react-navigation/native';
import { StyleSheet, View, NativeEventEmitter, NativeModules } from 'react-native';
import { StatusBar } from 'expo-status-bar';
const { StatusBarManager } = NativeModules;


const App = () => {

  let StatusBarHeight: number = 0;
  StatusBarManager.getHeight(({ height }: { height: number }) => { StatusBarHeight = height });

  return (
    <View style={styles.container}>
      <StatusBar style={"auto"} />
      <NavigationContainer><Tabbar /></NavigationContainer>
    </View>
  );
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
});

export default App;
